import React from 'react'
import { MdPlace }from 'react-icons/md';
import PText from './PText'
function ContactInfoItems({
    icon = <MdPlace/>,
    text ='this is an info',
}) {
  return (
    <div>
           <div className="icon">{icon} </div>
           <div className="info">
            <PText>{text}</PText>
           </div>
    </div>
  )
}

export default ContactInfoItems
